   }

   componentDidMount() {

   }


  render() {
    return (
      <div className={curnet.container}>
        <div className={curnet.top}></div>
        <div className={curnet.center}>
          <div className={curnet.center_chart}>
            <Dashboard/>
          </div>
        </div>
        <div className={curnet.bottom}></div>
      </div>
    )
  }

}
